import { ContainerApp } from "./App.styled";
import Dropdown from "./Dropdown";
import ColorPicker from "./ColorPicker/ColorPicker";

const colorPeckerOption = [
  {
    label: "red",
    color: "#F44336",
  },
  {
    label: "green",
    color: "#4CAF50",
  },
  {
    label: "blue",
    color: "#2196F3",
  },
  {
    label: "grey",
    color: "#607D8B",
  },
  {
    label: "pink",
    color: "#E91E63",
  },
  {
    label: "indigo",
    color: "#3F51B5",
  },
];

export const App = () => {
  return (
    <ContainerApp>
      <ColorPicker options={colorPeckerOption} />
      <Dropdown />
    </ContainerApp>
  );
};
